using Prism.Commands;
using Prism.Mvvm;
using Prism.Navigation;
using System;
using System.Collections.Generic;
using System.Collections.ObjectModel;
using System.Linq;
using System.Text;
using Xamarin.Forms;

namespace CardViewTap.ViewModels
{
    public class MainPageViewModel : ViewModelBase
    {
        private ObservableCollection<CarouselImage> images;
        public ObservableCollection<CarouselImage> Images
        {
            get { return images; }
            set { SetProperty(ref images, value); }
        }

        public DelegateCommand Command_ImageTapped => new DelegateCommand(On_ImageTapped);

        public MainPageViewModel(INavigationService navigationService)
            : base(navigationService)
        {
            Title = "Main Page";

            Images = new ObservableCollection<CarouselImage>();
            Images.Add(new CarouselImage
            {
                source = "data:image/jpeg;base64,"
            });
            Images.Add(new CarouselImage
            {
                source = "data:image/jpeg;base64,"
            });
            
        }

        private void On_ImageTapped()
        {
            Title = "Carousel Tapped";
        }
    }

    public class CarouselImage
    {
        public string source { get; set; }
    }
}
